import styled from 'styled-components'

export const StyledCenter = styled.div`
  text-align: center;
`;

export const StyledOpacity = styled.div`
  position:absolute;
  margin:0;
  padding:0;
  width:100%;
  height:100%;
  opacity: 0.9;
  background: #ccc;
`;

export const Styledh1 = styled.h1`
  text-decoration: underline;
`;
